static PyObject *qstrvec2pylist(const qstrvec_t &vec)
{
  size_t n = vec.size();
  PyObject *py_list = PyList_New(n);
  for ( size_t i=0; i < n; ++i )
    PyList_SetItem(
            py_list,
            i,
            IDAPyStr_FromUTF8AndSize(vec[i].c_str(), vec[i].length()));
  return py_list;
}


